To get useful data to add to our maps, we first need some useful data structures to populate with data from the XdpContext. We want to log the Source IP Address of incoming traffic, so we'll need to: Read the Ethernet Header to determine if this is an IPv4 Packet Read the Source IP Address from the IPv4 Header The two structs in the kernel for this are ethhdr from uapi/linux/if_ether.h and iphdr from uapi/linux/ip.h. If I were to use bindgen to generate Rust bindings for those headers, I'd be tied to the kernel version of the system that I'm developing on. This is where aya-gen comes in to play. It can easily generate bindings for using the BTF information in /sys/kernel/btf/vmlinux. Once the bindings are generated and checked in to our repository they shouldn't need to be regenerated again unless we need to add a new struct. Lets use xtask to automate this so we can easily reproduce this file in future. We'll add the following content to xtask/src/codegen.rs use aya_gen::btf_types;
use std::{ fs::File, io::Write, path::{Path, PathBuf},
}; pub fn generate() -> Result<(), anyhow::Error> { let dir = PathBuf::from("myapp-ebpf/src"); let names: Vec<&str> = vec!["ethhdr", "iphdr"]; let bindings = btf_types::generate(Path::new("/sys/kernel/btf/vmlinux"), &names, false)?; // Write the bindings to the $OUT_DIR/bindings.rs file. let mut out = File::create(dir.join("bindings.rs"))?; write!(out, "{}", bindings).expect("unable to write bindings to file"); Ok(())
} This will generate a file called myapp-ebpf/src/bindings.rs. If you've chosen an application name other than myapp you'll need to adjust the path appropriately. Add a new dependencies to xtask/Cargo.toml: [dependencies]
aya-gen = { git = "http://github.com/alessandrod/aya", branch = "main" } And finally, we must register the command in xtask/src/main.rs: mod build_ebpf;
mod codegen; use std::process::exit; use structopt::StructOpt;
#[derive(StructOpt)]
pub struct Options { #[structopt(subcommand)] command: Command,
} #[derive(StructOpt)]
enum Command { BuildEbpf(build_ebpf::Options), Codegen,
} fn main() { let opts = Options::from_args(); use Command::*; let ret = match opts.command { BuildEbpf(opts) => build_ebpf::build(opts), Codegen => codegen::generate(), }; if let Err(e) = ret { eprintln!("{:#}", e); exit(1); }
} Once we've generated our file using cargo xtask codegen from the root of the project. These can then be accessed from within myapp-ebpf/src/main.rs: mod bindings;
use bindings::{ethhdr, iphdr};

