In order to read from the AsyncPerfEventArray, we have to call AsyncPerfEventArray::open() for each online CPU, then we have to poll the file descriptor for events. While this is do-able using PerfEventArray and mio or epoll, the code is much less easy to follow. Instead, we'll use tokio to make our user-space application async. Let's add some dependencies to myapp/src/Cargo.toml: [dependencies]
aya = { git = "https://github.com/alessandrod/aya", branch="main", features=["async_tokio"] }
myapp-common = { path = "../myapp-common", features=["userspace"] }
anyhow = "1.0.42"
bytes = "1"
tokio = { version = "1.9.0", features = ["full"] } And adjust our myapp/src/main.rs to look like this: use aya::{ maps::perf::AsyncPerfEventArray, programs::{Xdp, XdpFlags}, util::online_cpus, Bpf,
};
use bytes::BytesMut;
use std::{ convert::{TryFrom, TryInto}, env, fs, net,
};
use tokio::{signal, task}; use myapp_common::PacketLog; #[tokio::main]
async fn main() -> Result<(), anyhow::Error> { let path = match env::args().nth(1) { Some(iface) => iface, None => panic!("not path provided"), }; let iface = match env::args().nth(2) { Some(iface) => iface, None => "eth0".to_string(), }; let data = fs::read(path)?; let mut bpf = Bpf::load(&data, None)?; let probe: &mut Xdp = bpf.program_mut("xdp")?.try_into()?; probe.load()?; probe.attach(&iface, XdpFlags::default())?; let mut perf_array = AsyncPerfEventArray::try_from(bpf.map_mut("EVENTS")?)?; for cpu_id in online_cpus()? { let mut buf = perf_array.open(cpu_id, None)?; task::spawn(async move { let mut buffers = (0..10) .map(|_| BytesMut::with_capacity(1024)) .collect::<Vec<_>>(); loop { let events = buf.read_events(&mut buffers).await.unwrap(); for i in 0..events.read { let buf = &mut buffers[i]; let ptr = buf.as_ptr() as *const PacketLog; let data = unsafe { ptr.read_unaligned() }; let src_addr = net::Ipv4Addr::from(data.ipv4_address); println!("LOG: SRC {}, ACTION {}", src_addr, data.action); } } }); } signal::ctrl_c().await.expect("failed to listen for event"); Ok::<_, anyhow::Error>(())
} This will now spawn a tokio::task to read each of the AsyncPerfEventArrayBuffers contained in out AsyncPerfEventArray. When we receive an event, we use read_unaligned to read our data into a PacketLog. We then use println! to log the event to the console. We no longer need to sleep, as we run until we receive the CTRL+C signal.
